//MEDIA QUERIES
/* 
    Phones = 0px-600px,
    Tablet(Portrait) = 600px-900px,
    Tablet(Landscape) = 900px-1200px
    Desktop = 1200px-1800px (Regular styles apply)
    Big Desktop = >1800px 
*/
@mixin respond($device) {
    @if($device == phone){
        @media (max-width: 37.5em) {
            @content;
        }
    }

    @if($device == tab-port){
        @media (max-width: 56.25em) {
            @content;
        }
    }

    @if($device == tab-land){
        @media (max-width: 75em) {
            @content;
        }
    }

    @if($device == big-desk){
        @media (min-width: 112.5em) {
            @content;
        }
    }
}

